import React, { useState, useEffect } from 'react';
import { 
  BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, 
  PieChart, Pie, Cell, 
  LineChart, Line,
  ComposedChart,
  ResponsiveContainer,
  ReferenceLine,
  AreaChart, Area
} from 'recharts';
import axios from 'axios';

function ExploratoryDataAnalysisPage() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [mlData, setMlData] = useState(null);
  const [classificationReport, setClassificationReport] = useState(null);
  const [bankData, setBankData] = useState(null);

  useEffect(() => {
    const fetchMLData = async () => {
      try {
        // Fetch ML Data
        const mlResponse = await axios.get('http://127.0.0.1:5000/api/ml');
        setMlData(mlResponse.data);
        
        // Transform classification report for visualization
        const reportData = mlResponse.data.report;
        const formattedReport = [
          { 
            metric: 'Precision', 
            approved: reportData['1']['precision'] * 100, 
            declined: reportData['0']['precision'] * 100 
          },
          { 
            metric: 'Recall', 
            approved: reportData['1']['recall'] * 100, 
            declined: reportData['0']['recall'] * 100 
          },
          { 
            metric: 'F1-Score', 
            approved: reportData['1']['f1-score'] * 100, 
            declined: reportData['0']['f1-score'] * 100 
          }
        ];

        setClassificationReport(formattedReport);

        // Fetch raw bank data for EDA
        const dataResponse = await axios.get('http://127.0.0.1:5000/api/dataset');
        setBankData(dataResponse.data);

        setLoading(false);
      } catch (err) {
        setError(err);
        setLoading(false);
      }
    };

    fetchMLData();
  }, []);

  // Previous rendering logic remains the same...

  // Additional plots for EDA
  const renderAdditionalPlots = () => {
    if (!bankData) return null;

    return (
      <div className="eda-additional-plots grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Income Distribution by Loan Status */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Income Distribution by Loan Status</h2>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={bankData.income_by_loan_status}>
              <XAxis dataKey="loan_status" />
              <YAxis label={{ value: 'Average Income', angle: -90, position: 'insideLeft' }} />
              <Tooltip />
              <Bar dataKey="avg_income" fill="#3B82F6">
                {bankData.income_by_loan_status.map((entry, index) => (
                  <Cell 
                    key={`cell-${index}`} 
                    fill={entry.loan_status === 'Approved' ? '#4CAF50' : '#F44336'} 
                  />
                ))}
              </Bar>
            </BarChart>
          </ResponsiveContainer>
        </div>

        {/* Age vs Credit Card Average Spending */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Age vs Credit Card Spending</h2>
          <ResponsiveContainer width="100%" height={300}>
            <ScatterChart>
              <XAxis type="number" dataKey="Age" name="Age" />
              <YAxis type="number" dataKey="CCAvg" name="Avg Credit Card Spending" />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} />
              <Scatter 
                data={bankData.age_cc_scatter} 
                fill="#8884d8"
                name="Clients"
              />
            </ScatterChart>
          </ResponsiveContainer>
        </div>

        {/* Education Level Distribution */}
        <div className="bg-white shadow-lg rounded-lg p-6">
          <h2 className="text-xl font-semibold mb-4">Education Level Distribution</h2>
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie
                data={bankData.education_distribution}
                cx="50%"
                cy="50%"
                labelLine={false}
                outerRadius={80}
                fill="#8884d8"
                dataKey="count"
                label={({name, percent}) => `${name} ${(percent * 100).toFixed(0)}%`}
              >
                {bankData.education_distribution.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={['#0088FE', '#00C49F', '#FFBB28'][index % 3]} />
                ))}
              </Pie>
              <Tooltip />
              <Legend />
            </PieChart>
          </ResponsiveContainer>
        </div>

        {/* Securities vs CD Account Correlation */}
        <div className="bg-white shadow-lg rounded-lg p-6 col-span-full">
          <h2 className="text-xl font-semibold mb-4">Securities vs CD Account</h2>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={bankData.securities_cd_correlation}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="account_type" />
              <YAxis label={{ value: 'Percentage', angle: -90, position: 'insideLeft' }} />
              <Tooltip />
              <Bar dataKey="percentage" fill="#82CA9D">
                {bankData.securities_cd_correlation.map((entry, index) => (
                  <Cell 
                    key={`cell-${index}`} 
                    fill={entry.account_type === 'Securities Account' ? '#3B82F6' : '#10B981'} 
                  />
                ))}
              </Bar>
            </BarChart>
          </ResponsiveContainer>
        </div>
      </div>
    );
  };

  // Rest of the component remains the same...

  return (
    <div className="page-container">
      {/* Existing visualizations */}
      {/* New additional plots section */}
      {renderAdditionalPlots()}
    </div>
  );
}

export default ExploratoryDataAnalysisPage;
